import Bird from './bird.png'
import './styles.css'

export default function ExploreBar() {
  return (
    <div>
      <img src={Bird} className="birdLogo" alt="chitter logo"/>
      <h1>Explore</h1>
      <h1>Tweet</h1>
    </div>
  )
}
